require.config({"config": {
        "jsbuild":{"Magento_Tinymce3/tiny_mce/plugins/contextmenu/editor_plugin_src.js":"/**\n * editor_plugin_src.js\n *\n * Copyright 2009, Moxiecode Systems AB\n * Released under LGPL License.\n *\n * License: http://tinymce.moxiecode.com/license\n * Contributing: http://tinymce.moxiecode.com/contributing\n */\n\n(function() {\n\tvar Event = tinymce.dom.Event, each = tinymce.each, DOM = tinymce.DOM;\n\n\t/**\n\t * This plugin a context menu to TinyMCE editor instances.\n\t *\n\t * @class tinymce.plugins.ContextMenu\n\t */\n\ttinymce.create('tinymce.plugins.ContextMenu', {\n\t\t/**\n\t\t * Initializes the plugin, this will be executed after the plugin has been created.\n\t\t * This call is done before the editor instance has finished it's initialization so use the onInit event\n\t\t * of the editor instance to intercept that event.\n\t\t *\n\t\t * @method init\n\t\t * @param {tinymce.Editor} ed Editor instance that the plugin is initialized in.\n\t\t * @param {string} url Absolute URL to where the plugin is located.\n\t\t */\n\t\tinit : function(ed) {\n\t\t\tvar t = this, showMenu, contextmenuNeverUseNative, realCtrlKey;\n\n\t\t\tt.editor = ed;\n\n\t\t\tcontextmenuNeverUseNative = ed.settings.contextmenu_never_use_native;\n\n\t\t\t/**\n\t\t\t * This event gets fired when the context menu is shown.\n\t\t\t *\n\t\t\t * @event onContextMenu\n\t\t\t * @param {tinymce.plugins.ContextMenu} sender Plugin instance sending the event.\n\t\t\t * @param {tinymce.ui.DropMenu} menu Drop down menu to fill with more items if needed.\n\t\t\t */\n\t\t\tt.onContextMenu = new tinymce.util.Dispatcher(this);\n\n\t\t\tshowMenu = ed.onContextMenu.add(function(ed, e) {\n\t\t\t\t// Block TinyMCE menu on ctrlKey and work around Safari issue\n\t\t\t\tif ((realCtrlKey !== 0 ? realCtrlKey : e.ctrlKey) && !contextmenuNeverUseNative)\n\t\t\t\t\treturn;\n\n\t\t\t\tEvent.cancel(e);\n\n\t\t\t\t// Select the image if it's clicked. WebKit would other wise expand the selection\n\t\t\t\tif (e.target.nodeName == 'IMG')\n\t\t\t\t\ted.selection.select(e.target);\n\n\t\t\t\tt._getMenu(ed).showMenu(e.clientX || e.pageX, e.clientY || e.pageY);\n\t\t\t\tEvent.add(ed.getDoc(), 'click', function(e) {\n\t\t\t\t\thide(ed, e);\n\t\t\t\t});\n\n\t\t\t\ted.nodeChanged();\n\t\t\t});\n\n\t\t\ted.onRemove.add(function() {\n\t\t\t\tif (t._menu)\n\t\t\t\t\tt._menu.removeAll();\n\t\t\t});\n\n\t\t\tfunction hide(ed, e) {\n\t\t\t\trealCtrlKey = 0;\n\n\t\t\t\t// Since the contextmenu event moves\n\t\t\t\t// the selection we need to store it away\n\t\t\t\tif (e && e.button == 2) {\n\t\t\t\t\trealCtrlKey = e.ctrlKey;\n\t\t\t\t\treturn;\n\t\t\t\t}\n\n\t\t\t\tif (t._menu) {\n\t\t\t\t\tt._menu.removeAll();\n\t\t\t\t\tt._menu.destroy();\n\t\t\t\t\tEvent.remove(ed.getDoc(), 'click', hide);\n\t\t\t\t}\n\t\t\t};\n\n\t\t\ted.onMouseDown.add(hide);\n\t\t\ted.onKeyDown.add(hide);\n\t\t\ted.onKeyDown.add(function(ed, e) {\n\t\t\t\tif (e.shiftKey && !e.ctrlKey && !e.altKey && e.keyCode === 121) {\n\t\t\t\t\tEvent.cancel(e);\n\t\t\t\t\tshowMenu(ed, e);\n\t\t\t\t}\n\t\t\t});\n\t\t},\n\n\t\t/**\n\t\t * Returns information about the plugin as a name/value array.\n\t\t * The current keys are longname, author, authorurl, infourl and version.\n\t\t *\n\t\t * @method getInfo\n\t\t * @return {Object} Name/value array containing information about the plugin.\n\t\t */\n\t\tgetInfo : function() {\n\t\t\treturn {\n\t\t\t\tlongname : 'Contextmenu',\n\t\t\t\tauthor : 'Moxiecode Systems AB',\n\t\t\t\tauthorurl : 'http://tinymce.moxiecode.com',\n\t\t\t\tinfourl : 'http://wiki.moxiecode.com/index.php/TinyMCE:Plugins/contextmenu',\n\t\t\t\tversion : tinymce.majorVersion + \".\" + tinymce.minorVersion\n\t\t\t};\n\t\t},\n\n\t\t_getMenu : function(ed) {\n\t\t\tvar t = this, m = t._menu, se = ed.selection, col = se.isCollapsed(), el = se.getNode() || ed.getBody(), am, p;\n\n\t\t\tif (m) {\n\t\t\t\tm.removeAll();\n\t\t\t\tm.destroy();\n\t\t\t}\n\n\t\t\tp = DOM.getPos(ed.getContentAreaContainer());\n\n\t\t\tm = ed.controlManager.createDropMenu('contextmenu', {\n\t\t\t\toffset_x : p.x + ed.getParam('contextmenu_offset_x', 0),\n\t\t\t\toffset_y : p.y + ed.getParam('contextmenu_offset_y', 0),\n\t\t\t\tconstrain : 1,\n\t\t\t\tkeyboard_focus: true\n\t\t\t});\n\n\t\t\tt._menu = m;\n\n\t\t\tm.add({title : 'advanced.cut_desc', icon : 'cut', cmd : 'Cut'}).setDisabled(col);\n\t\t\tm.add({title : 'advanced.copy_desc', icon : 'copy', cmd : 'Copy'}).setDisabled(col);\n\t\t\tm.add({title : 'advanced.paste_desc', icon : 'paste', cmd : 'Paste'});\n\n\t\t\tif ((el.nodeName == 'A' && !ed.dom.getAttrib(el, 'name')) || !col) {\n\t\t\t\tm.addSeparator();\n\t\t\t\tm.add({title : 'advanced.link_desc', icon : 'link', cmd : ed.plugins.advlink ? 'mceAdvLink' : 'mceLink', ui : true});\n\t\t\t\tm.add({title : 'advanced.unlink_desc', icon : 'unlink', cmd : 'UnLink'});\n\t\t\t}\n\n\t\t\tm.addSeparator();\n\t\t\tm.add({title : 'advanced.image_desc', icon : 'image', cmd : ed.plugins.advimage ? 'mceAdvImage' : 'mceImage', ui : true});\n\n\t\t\tm.addSeparator();\n\t\t\tam = m.addMenu({title : 'contextmenu.align'});\n\t\t\tam.add({title : 'contextmenu.left', icon : 'justifyleft', cmd : 'JustifyLeft'});\n\t\t\tam.add({title : 'contextmenu.center', icon : 'justifycenter', cmd : 'JustifyCenter'});\n\t\t\tam.add({title : 'contextmenu.right', icon : 'justifyright', cmd : 'JustifyRight'});\n\t\t\tam.add({title : 'contextmenu.full', icon : 'justifyfull', cmd : 'JustifyFull'});\n\n\t\t\tt.onContextMenu.dispatch(t, m, el, col);\n\n\t\t\treturn m;\n\t\t}\n\t});\n\n\t// Register plugin\n\ttinymce.PluginManager.add('contextmenu', tinymce.plugins.ContextMenu);\n})();\n"}
}});
